import React from 'react';
const Card=(props)=>{
	const[name,email,id]=props;
	return(

			<div className='tc bg-light-green dib br3 ma2 grow'>
			<img alt='robots' src={`https://robohash.org/${props.id}?200x200`}/>
			<div>
			<h2>{props.name}</h2>
			<p> {props.email}</p>

			</div>
			</div>

		);
}
export default Card;
